import React from 'react';
import {Nav, Navbar} from "react-bootstrap";
import linkedin from "../images/linkedin.png";
import github from "../images/github.png";
import email from "../images/email.png";

class Footer extends React.Component {
    render() {
        return (
            <div className="footer-container">
                <div className="about">
                    <p className="section-heading" style={{marginTop: '0', paddingTop: '2em'}}>
                        About
                    </p>
                    <p>
                        My name is Ahmed Akbarali. I'm a Computer Science B.Sc from York University. <br/>
                        My focus is on Web Applications and websites, using React and NodeJS.
                    </p>
                </div>
                <div className="contact">
                    <p className="section-heading" style={{marginTop: '0', paddingTop: '2em'}}>
                        Contact
                    </p>
                    <p>
                        If you would like to contact me feel free to do so using one of the links below.
                    </p>
                    <Navbar className="" style={{fontSize: '32px'}}>
                        <Nav.Item>
                            <Nav.Link href="https://www.linkedin.com/in/ahmed-akbarali-4799b570/" target="_blank">
                                <img
                                    className="header-image"
                                    src={linkedin}
                                    alt="linkedin"
                                    style={{ filter: 'invert(1)'}}
                                />
                            </Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link href="https://www.github.com/AhmedAkbarali" target="_blank">
                                <img
                                    className="header-image"
                                    src={github}
                                    alt="github"
                                    style={{filter: 'invert(1)'}}
                                />
                            </Nav.Link>
                        </Nav.Item>
                        <Nav.Item>
                            <Nav.Link href="mailto:ahmed.amin.akbarali@gmail.com" target="_blank">
                                <img
                                    className="header-image"
                                    src={email}
                                    alt="email"
                                    style={{filter: 'invert(1)'}}
                                />
                            </Nav.Link>
                        </Nav.Item>
                    </Navbar>
                </div>
            </div>
        );
    }
}

export default Footer;
